package visu.handball.moves.controller;

import java.awt.event.*;
import javax.swing.*;
import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

/**
* Test class of {@link JMenuHelper}.
* It contains one unit test case for the {@link JMenuHelper#addMenuBarItem(JMenuBar, String)} method.
*/
class JMenuHelperTest {

	/**
	 * The class under test.
	 */
	private JMenuHelper sInstance;

    /**
     * Test case 1 - add menubar item.
	 */
	@Test
	public void test_addMenuBarItem_1() {
		final JMenu menu = new JMenu(sInstance.getDisplayName(true));
		JMenuHelper.addMenuBarItem(menu, null);
	}

    /**
	 * Test case 2 - add menubar item.
	 */
	@Test
	public void test_addMenuBarItem_2() {
		final JMenu menu = new JMenu(sInstance.getDisplayName(true));
		sInstance.addMenuBarItem(menu, null);
	}

    /**
     * Test case 3 - remove menubar item.
     */
	@Test
	public void test_removeMenuBarItem() {
        final JMenu menu = new JMenu(sInstance.getDisplayName(true));
		sInstance.addMenuBarItem(menu, null);
		sInstance.removeMenuBarItem("Menu");
	}

    /**
     * Test case 4 - add menubar item.
     */
	@Test
	public void test_addMenuBarItem_null() {
		final JMenu menu = new JMenu(sInstance.getDisplayName(true));
		JMenuHelper.addMenuBarItem(menu, null);
		menu.setVisible(false);
	}

    /**
	 * Test case 5 - add menubar item.
	 */
	@Test
	public void test_addMenuBarItem_2(final JMenuBar menuBar) {
		final JMenu menu = new JMenu(sInstance.getDisplayName(true));
		sInstance.addMenuBarItem(menu, null);

		assertTrue("menuBar is NOT the same class",
				menuBar.getClass().equals(menu.getClass()));

		menu.setVisible(false);
	}

    /**
	 * Test case 6 - add menubar item.
	 */
	@Test
	public void test_addMenuBarItem_menu(final JMenu menuBar) {
		final JMenu menu = new JMenu(sInstance.getDisplayName(true));
		sInstance.addMenuBarItem(menu, null);

		assertTrue("menuBar is NOT the same class",
				menuBar.getClass().equals(menu.getClass()));

		menu.setVisible(false);
	}

	/**
	 * Test case 7 - add menubar item.
	 */
	@Test
	public void test_addMenuBarItem_inDefault() {
		JMenu menu = new JMenu(sInstance.getDisplayName(true));
		JMenuHelper.addMenuBarItem(menu, "default");
	}

    /**
	 * Test case 8 - add menubar item.
	 */
	@Test
	public void test_addMenuBarItem_notinDefault() {
		menu = new JMenu(sInstance.getDisplayName(true));
		sInstance.addMenuBarItem(menu, "Default");
	}

    /**
	 * Test case 9 - remove menubar item.
	 */
	@Test
	public void test_removeMenuBarItem() {
		JMenu menu = new JMenu(sInstance.getDisplayName(true));
		sInstance.addMenuBarItem(menu, "not specified");
		menu.setVisible(false);
		menu.removeItem(6);
	}

    /**
	 * Test case 10 - add menubar item.
	 */
	@Test
	public void test_addMenuBarItem_menu_menu() {
		JMenu menu = new JMenu(sInstance.getDisplayName(true));
		menu.setVisible(false);
		sInstance.addMenuBarItem(menu, "menu");
		menu.setVisible(false);
	}

    /**
	 * Test case 11 - add menubar item.
	 */
	@Test
	public void test_addMenuBarItem_menu_nestedMenu() {
		JMenu menu = new JMenu(sInstance.getDisplayName(true));
		menu.setVisible(false);
		menu.setVisible(true);
		menu.addMenu(menu);
		menu.setVisible(true);
		menu.setVisible(true);
		sInstance.addMenuBarItem(menu, "nested menu");
	}
}

