class JMenuHelperTest {

    private JMenuHelper controller;

    /**
     * Constructor for {@link JMenuHelperTest} class.
     */
    public JMenuHelperTest() {
    }

    /**
     * Test addMenuBarItem
     */
    @Test
    public void addMenuBarItem() {
        // Add an item with a MenuBar item
        JMenuItem item = controller.addMenuBarItem("Menu Item 1", "Menu Item 2");        

        // Remove with an ActionBar item
        item = controller.addMenuBarItem("Action Bar Item 2", "");

        // Remove a MenuBar item which was added before the ActionBar item was added
        controller.removeMenuBarItem("Action Bar Item 1");

        // Assertion
        assertNotNull(item);
        assertEquals("Menu Item 1", item.getText());
        assertEquals("Menu Item 2", item.getName());
    }
}

