package visu.handball.moves.controller;

import java.awt.event.*;
import javax.swing.*;
import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

/**
* Test class of {@link JMenuHelper}.
* It contains one unit test case for the {@link JMenuHelper#addMenuBarItem(JMenuBar, String)} method.
*/
class JMenuHelperTest {
		private final JMenu menu = new JMenu();
		private final JMenu subMenu = new JMenu();
		private final JMenu subMenuSubMenu = new JMenu();
		private final JComponent component = new JLabel();
		public  JMenuHelperTest(String[] parameters) {
			addSubMenu();
			getComponent().setText("Component.text - label Text");
			addMenuItem(menu);

		}
		/**
		* Add a {@link JMenuItem} that has been added.
		*
		* @param menuItem a JMenuItem
		* @return added JMenuItem
		*/
		public static JMenuItem addMenuItem(JMenuItem menuItem) {
		 	return addMenuItem(menu, menuItem);
		}
		/**
		 * Add a {@link JMenuItem} to the menubar but with different text value.
		*
		* @param menu a JMenu
		* @param menuItem a JMenuItem
		* @return added JMenuItem
		*/
		public static JMenuItem addMenuItem(JMenu menu, JMenuItem menuItem) {
		 	menuItem.setText("Component.text - Label Text");
		 	menuItem.addActionListener(menuItem.createActionListener(new ActionListener() {

			  public void actionPerformed(ActionEvent e) {
			    getComponent().setText("");
			  }

		 	}));
			menuItem.setName(menuItem.getText());
			menu.add(menuItem);
			return menuItem;
		}
		/**
		* Return the component of the JMenu.
		*
		* @return a JComponent
		*/
		public static JComponent getComponent() {
		 	  return component;
		}
		/**
		* Return the component of the JMenu of a given index.
		*
		* @param index an integer in the range [0..menuItems.size()]
		* @return a JComponent
		*/
		public static JComponent getComponent(int index) {
		 	  return component;
		}
		/**
		* Return the JMenu of a given index.
		*
		* @param menuItemIndex an integer in the range [0..menuItems.size()]
		* @return a JMenu
		*/
		public static JMenu getMenu(int menuItemIndex) {
		 	  return menu;
		}
		/**
		* Returns the name of the Item whose state is equal to the given state.
		*
		* @param state an integer of the value {@link State#NORMAL} to check the Item for.
		* @return the name of the state Item
		*/
		public static String stateName(int state) {
		 	  return State.NORMAL.toString() + "." + String.valueOf(state);
		}
	public static void addSubMenu() {
	 	  subMenu.setText("Sub-Menu...");
	 	  addMenuBarItem(subMenu, "SubMenu");
	 	  subMenu.setName("SUB-MENU");
	 	  subMenuSubMenu.setText("SUB-MENU-Sub-MENU");
		}
		public static void addSubMenu(String s) {
	 	  String s2 = "Sub-MENU";
	 		addSubMenu(s, s2);
		}
		public static void addSubMenu(String s, String s2) {
		 	menu.add(s2);
		}
}

